    "2013-03-15T23:22:57.190520",nt"name": "new-evidence-on-the-hydrothermal-system-in-long-valley-caldera-california-from-wells-fluid-samp",nt"isopen":
    false,nt"url": null,nt"notes": "Data collected since 1985 from test drilling,
    fluid sampling, and geologic and geophysical investigations provide a clearer definition
    of the hydrothermal system in Long Valley caldera than was previously available.
    This information confirms the existence of high-temperature (>200C) reservoirs within
    the volcanic fill in parts of the west moat. These reservoirs contain fluids which
    are chemically similar to thermal fluids encountered in the central and eastern
    parts of the caldera. ",nt"license_title": null,nt"extras": [{ntt"key":
